        public string GetLinkByName(string country, string name)
        {
            switch(country)
            {
                default:
                    return "";

                case "USA":
                    if (templates_usa.ContainsKey(name))
                        return templates_usa[name].imageLink;
                    else
                        return "https://encyclopedia.warthunder.com/i/slots/ussr_bt_5.png";

