        public Dictionary<string, VehicleData> GetDataByCountry(string country)
        {
            switch (country)
            {
                default:
                case "USA":
                    return templates_usa;

                case "Germany":
                    return templates_germany;

                case "USSR":
                    return templates_ussr;

                case "Great Britain":
                    return templates_great_britain;

                case "Japan":
                    return templates_japan;

                case "China":
                    return templates_china;

                case "Italy":
                    return templates_italy;

                case "France":
                    return templates_france;

                case "Sweden":
                    return templates_sweden;

                case "Israel":
